                            "description": "Арлетти сообщает родителям (Каролине и Рожерио) о том, что она мечтает стать моделью. Каролина узнает, что у Рожерио есть вторая семья и решает переехать с Арлетти в квартиру своей матери Илды в Сан-Паулу. Бизнесмен Алекс заинтересован в молодых моделях, он просит своего коллегу и друга Роберио организовать ему встречу с владелицей модельного агентства Фанни Ричард. Модель Самия признается Алексу, что скучает по нему и его ласкам. Бабушка Арлетт (Илда) знакомит Каролину и внучку со своей квартиранткой Дарлени. Илда и Дарлени помогают Арлетти получить стипендию для обучения в престижной школе Сан-Пауло. Дарлени преподает в этой школе. Она рассказывает Арлетти о школе, о том, что в ней учатся дети из высших слоёв общества. Джованне (дочери Алекса) не понравилась Арлетти. Она с друзьями ведёт себя высокомерно и по-хамски по отношению к девушке. Гильерми и Эзиель успокаивают Арлетти и сочувствуют ей. Каролина ведет дочь в модельное агентство. Виски убеждает Фанни инвестировать в карьеру Арлетти. Фанни дает девушке сценическое имя Энжел.",
