                            "description": "Ольга пытается справиться с тяжелыми эмоциональными последствиями недавнего развода. Переезд в новую квартиру и трудный возраст дочери Наташи усугубляют ситуацию – нервы на пределе, а тут еще это письмо на стене… В 1941 году умирающий от голода мальчик Юра написал: … найдите Марту и скажите, что я люблю ее. Ольга с Наташей решают разыскать Марту. Они знакомятся с Максимом, проживающим с женой в бывшей квартире Марты. Максим рассказывает, что искать Марту пытался его покойный отец. Он оставил список всех Март нужного возраста, проживавших на тот момент в Ленинграде.",
