                            "description": "Преуспевающий бизнесмен Андрей Каморин несчастлив в семейной жизни. Он бы давно бросил свою жену Лизу, но деньги, вложенные в его строительный бизнес, принадлежат ей. На стороне у Каморина другая женщина – Нелли, которая не так давно родила ему сына. Тем временем и у Лизы появляется настойчивый ухажер Юра, который пытается раскрыть ей глаза на тайную жизнь Андрея. Дела в фирме Каморина идут, прибыли растут. Заместитель Андрея, его давний друг Гена Быков, выгодно размещает свободные средства - вкладывает их в покупку недвижимости и земли в разных странах. Андрей жалуется Гене на нестерпимую обстановку в семье, и тот предлагает выход - отправить жену на необитаемый остров в Тихом океане, обеспечив ее всем необходимым для существования. Чтобы круиз не показался странным, Гена готов подобрать ей компанию – людей, столь же надоевших своим родным и близким. Лиза, не заподозрив подвоха, соглашается. Кроме Андрея и Лизы в круиз отправляются еще одиннадцать человек.",
