                            "description": "1917 год. Глава Временного Правительства Керенский поручает следователю Генриху Ивановичу Свиттену расследовать  действия Григория Распутина во времена правления Николая, которые бы подтвердили, что этот человек был самым развратным и безбожным, главным представителем темных сил, погубившем Россию. Свиттен начинает расследование и узнает все мельчайшие подробности из жизни Распутина.\nВ деревне Покровское, где жил Распутин, мужики сильно избили его за то, что он своровал свою же лошадь, которую продал до этого цыганам. В той драке пострадала любимая дочь Распутина Мария, которую Григорий спас от раны. После этого он отправляется странствовать. В одном из монастырей он прославился тем, что спас жизнь плотнику, также остановив ему кровь. В монастырь наведалась Великая княгиня с головными болями. Распутин помог ей, и она пригласила его в Петербург.",
