                            "has_schedule": 1,
                            "description": "Посмотрев американский фильм, Марк Гаврилович Гурченко решает назвать новорожденную дочь Люси. Но в ЗАГСе ему объясняют, что такого имени в советской стране нет. Сошлись на имени Людмила, людям милая, которую дома все будут называть только Люся. 1953 год. Сразу после школы Люся едет в Москву и с первой попытки поступает во ВГИК, в мастерскую Герасимова и Макаровой. Наступает зима. На одном из занятий по актерскому мастерству раздосадованный Герасимов кричит Люсе, у которой не получается этюд о военном времени, что она холода и голода не видела. На следующее утро Зина Кириенко (сокурсница и подруга Люси) не может остановить босую девушку, шагающую по снегу. Люся не слышит подругу - она в образе Зои Космодемьянской, идущей на казнь, и выходит из него, только наткнувшись на мужчину, который с интересом наблюдает за смелой девчонкой. Им оказывается режиссер Василий Ордынский, тоже ученик Макаровой и Герасимова. Ордынский как раз ищет главную героиню для своего дебюта…",
