                            "description": "18 декабря 1940-го года Гитлер подписал Директиву № 21, известную сегодня как план Барбаросса. Широко распространено заблуждение, что немецкие планы попадали на стол Сталина едва ли не сразу после их подписания. В действительности, точную дату германского нападения советские разведчики назвать не смогли.  Всему советскому народу, его армии и руководству страны предстояло напрячь все силы, чтобы в этих условиях спасти Родину. А немецкое командование рассчитывало завершить военную кампанию в России всего за три-четыре месяца…",
