                            "has_schedule": 1,
                            "description": "В Турцию по приглашению Маши и Максима прилетают сваты. Радость от встречи с внуками и впечатления от пятизвездочного сервиса не укрыли от зорких глаз Будько странное поведение Ковалевых. Иван проводит собственное расследование и открывает Страшную Тайну.\r\nЛюбая другая семья, узнав ТАКОЕ, опустила бы руки. Но потому про любую другую семью сериалы и не снимают. А вот Будьки со свойственной им энергией принимаются за исправление ситуации и вовлекают Ковалевых в водоворот событий, который выносит героев фильма на празднование коралловой свадьбы Юрия и Ольги.\r\nИ вот там уже всех сватов настигает новое известие, которое любых других бабушек и дедушек повергло бы в уныние. Но только не наших героев!",
