                            "description": "Дом Строевых известен всему старинному подмосковному городку. Здесь с дореволюционных времен живут врачи, сюда люди приходят со своими болезнями и проблемами, потому что знают - здесь им обязательно помогут.\r\nВ победном 45-м в свой родной дом возвращается прославленный военный хирург Виктор Строев. Дома его ждет любящая жена Вера. Она тоже врач, работает в местном роддоме. Виктор привозит с фронта приемного сына Васю, которого он нашел в сожженной фашистами деревне. Мальчик не разговаривает, плохо спит по ночам - его не отпускает от себя война. Но согретый домашним теплом и заботой своих новых родителей, он выздоравливает, начинает говорить.\r\nВиктор устраивается на работу в крупную московскую клинику. Слава о его успешных операциях распространяется по всей столице.\r\nГлавврач клиники Борис Леонидович Фридберг завидует успеху коллеги. Он затевает интригу с участием красавицы Арины…",
