                            "has_schedule": 1,
                            "description": "Известный врач-репродуктолог встретил певицу ночного клуба, а через десять лет они опубликовали совместную работу, которая перевернула понимание людей о человеческой сексуальности. Октябрь, 1956 год. Университет Вашингтона, Сент Луис, Миссури. Здесь проходит чествование знаменитого доктора Уильяма Мастерса, с помощью которого очень многие семьи обрели счастье. Его инновации в акушерстве обеспечили ему позицию лидера в этой области. На среднем Западе установлен очень высокий стандарт врачебной помощи, настолько высокий, что на это все обращают внимание. Сам доктор Уильям – человек науки, поэтому он поручает речь проректору Скалли, извиняется и уходит – сегодня его рабочий день еще не закончился. Почти каждый день он приходит в кабинет, расположенный в комнате по соседству с той, где принимает клиентов проститутка. В институт приходит новая сотрудница – бывшая певица, красавица и только что разведенная женщина Вирджиния Джонсон. Многие обращают внимание на жгучую красавицу, с первых же дней помощник Мастерса Итан Хаас объяволяет, что Вирджиния будет его женой.",
